/*eslint-disable */
import { initializeApp } from "firebase/app";
import { getAuth, createUserWithEmailAndPassword } from "firebase/auth";

const app = initializeApp(firebaseConfig);
const auth = getAuth();

export { app, auth, createUserWithEmailAndPassword };
